import React, { Component } from 'react';

class CarouselLtArrow extends Component {
  render() {
    return (
      <a
        href="#"
        className="carousel__arrow carousel__arrow__left"
        onClick={this.props.onClick}
        >
        <i className="arrow left"></i>
      </a>
    );
  }
}

export default CarouselLtArrow;
